def get_indexer(self, target: AnyArrayLike, method: Optional[str] = None, limit: Optional[int] = None, tolerance: Optional[Any] = None) -> np.ndarray:

    self._check_method(method)

    if self.is_overlapping:
        msg = (
            "cannot handle overlapping indices; use "
            "IntervalIndex.get_indexer_non_unique"
        )
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex):
        # Convert the interval index values to a format that can be used by _engine.get_indexer
        target_as_values = np.asarray([(x.left, x.right) for x in target_as_index.values], dtype=target_as_index.values.dtype)

        # Now use the converted data with _engine.get_indexer
        indexer = self._engine.get_indexer(target_as_values)
    else:
        # Handle other cases as before
        if not is_object_dtype(target_as_index):
            target_as_index = self._maybe_convert_i8(target_as_index)
            indexer = self._engine.get_indexer(target_as_index.values)
        else:
            indexer = []
            for key in target_as_index:
                try:
                    loc = self.get_loc(key)
                except KeyError:
                    loc = -1
                indexer.append(loc)

    return ensure_platform_int(indexer)
